import React, { useState } from "react";
import { FaBars, FaTimes } from "react-icons/fa";
import classes from "./MenuStructure.module.css";

const MenuStructure = () => {
  const [isNavOpen, setIsNavOpen] = useState(false);

  const toggleNav = () => {
    setIsNavOpen(!isNavOpen);
  };

  return (
    <header>
      <h3>Logo</h3>
      <button className="nav_btn" onClick={toggleNav}>
        {isNavOpen ? <FaTimes /> : <FaBars />}
      </button>
      {isNavOpen && (
        <nav className={`${classes.nav} ${isNavOpen ? classes.responsive_nav : ""}`}>
          <a href="/#">Profile</a>
          <a href="/#">Language</a>
          <a href="/#">Help</a>
          <a href="/#">Logout</a>
          <a href="/#">About us</a>
          <button className={`nav_btn ${classes.nav_close}`} onClick={toggleNav}>
            <FaTimes />
          </button>
        </nav>
      )}
    </header>
  );
};

export default MenuStructure;
